import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './student-signup.css';

function Studentsignup({ onLoginClick, onSignupSubmit }) {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        studentId: '',
        branch: '',
        password: '',
    });
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Submit form logic
        onSignupSubmit();
        navigate('/');
    };

    return (
        <div className="auth-container">
            <div className="auth-form-wrapper">
                <h2>Student Signup</h2>
                <form onSubmit={handleSubmit}>
                    <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} required />
                    <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required />
                    <input type="text" name="studentId" placeholder="Student ID" value={formData.studentId} onChange={handleChange} required />
                    <input type="text" name="branch" placeholder="Branch" value={formData.branch} onChange={handleChange} required />
                    <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} required />
                    <button type="submit">Submit</button>
                </form>
                <p>Already have an account? <span onClick={onLoginClick}>Login</span></p>
            </div>
        </div>
    );
}

export default StudentSignup;
